import React, { useState, useEffect } from "react";
import Content from "../../components/Content";
import { useParams, useNavigate } from "react-router-dom";
import ExpedienteServices from "../../services/ExpedienteServices";
import axios from "axios";
import "../../styles/formularios.css";

// Librerias GRID
import Grid from "@mui/material/Grid";

// LIBRERIAS FORMULARIOS
import {
  FormControl,
  InputLabel,
  TextField,
  MenuItem,
  Select,
  Button,
} from "@mui/material";

const ExpedientesAdd = () => {
  const [padecimientos, setPadecimientos] = useState("");
  const [diagnostico, setDiagnostico] = useState("");
  const [histClinica, setHistClinica] = useState("");
  const [familiograma, setFamiliograma] = useState("");
  const [seguimiento, setSeguimiento] = useState("");
  const [paciente, setPaciente] = useState("");
  const [pacientes, setPacientes] = useState([]);
  
  const navigate = useNavigate();

  const server = "http://localhost:4002";

  const getData = async () => {
    const { data } = await axios.get(`${server}/pacientes`);
    console.log(data);
    setPacientes(data);
  };

  useEffect(() => {
    getData();
  }, []);

  const handlePadecimientos = (event) => {
    setPadecimientos(event.target.value);
  };
  const handleDiagnostico = (event) => {
    setDiagnostico(event.target.value);
  };
  const handleHistClinica = (event) => {
    setHistClinica(event.target.value);
  };
  const handleFamiliograma = (event) => {
    setFamiliograma(event.target.value);
  };
  const handleSeguimiento = (event) => {
    setSeguimiento(event.target.value);
  };
  const handlePaciente = (event) => {
    setPaciente(event.target.value);
  };
  const Cancelar = () => {
    navigate("/expedientes");
  };

  const handleSubmit = (event) => {
    const expediente = {
      padecimientos: padecimientos,
      diagnostico: diagnostico,
      histClinica: histClinica,
      familiograma: familiograma,
      seguimiento: seguimiento,
      idPaciente: parseInt(paciente),
    };



    console.log(expediente);
    ExpedienteServices.createExpediente(expediente);
    navigate("/expedientes");
  };

  return (
    <Content>
      <form>
        <div>
        <InputLabel id="paciente">Paciente</InputLabel>
              <select
                labelId="paciente"
                id="paciente"
                name="paciente"
                onChange={handlePaciente}
              >
                <option disabled selected>Selecciona un paciente</option>
                {pacientes.map((paciente) => (
                  <option value={paciente.idPaciente}>
                    {paciente.nomPaciente} {paciente.ap1Paciente} {paciente.ap2Paciente}
                  </option>
                ))}
              </select>
        </div>
        <label for="padecimientos">Padecimientos</label>
        <input type="text" name="padecimientos" id="padecimientos" onChange={handlePadecimientos} placeholder="Escribe tus padecimientos"/>
        <label for="histCli">Historia Clinica</label>
	      <input type="text" name="histCli" id="histCli" onChange={handleHistClinica} placeholder="Historia clinica"/>
        <label for="diagnostico">Diagnostico</label>
	      <input type="text" name="diagnostico" id="diagnostico" onChange={handleDiagnostico} placeholder="Diagnostico"/>
        <label for="familiograma">Familiograma</label>
	      <input type="text" name="familiograma" id="familiograma" onChange={handleFamiliograma} placeholder="Familiograma"/>
        <label for="seguimiento">Seguimiento</label>
	      <input type="text" name="seguimiento" id="seguimiento" onChange={handleSeguimiento} placeholder="Seguimiento"/>
        <input type="submit" name="guardar" value="Guardar"/>
        <input type="submit" name="cancelar" value="Cancelar"/>
      </form>
    </Content>
      


    



